import React, { Component } from 'react';

class eventCards extends Component {
    constructor() {
        super();
        this.state = {}
    }
    render() {
        let deck = this.props.eventCards;
        let liveCards = []
        for(let i = 0; i < 5; i++){
            liveCards.push(eventCards[0])
            deck.unshift(0)
        }
        console.log(deck);
        console.log(liveCards);
        return (
            <div>
            </div>
        )
    };
}

export default eventCards;
